import getFormattedCurrentWeather from './services/weatherService';
import { useState } from 'react';

function App() {

  const [query, setQuery] = useState({q: 'berlin'})
  const [units, setUnits] = useUnits('metric')
  const [weather, setWeather] = useState({q: 'berlin'})

  const fetchWeather = async () => {
    const data = await getFormattedCurrentWeather({q: 'toronto'})
    console.log('This is the data' , data)
  };

  fetchWeather();

  return (
    <div className="mx-auto max-w-screen-md mt-4 py-5 px-32 bg-gradient-to-br from-cyan-700 to-blue-700 hfit shadow-xl shadow-gray-400 rounded-3xl" >
      <TopLocations />
      <Inputs />

      <LocationTime />
      <TempDetails />

    </div>
  );
}

export default App;
